import React, { Component } from "react";

class Game extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: props.id,
      name: props.name,
      availableIn: props.availableIn,
      status: props.status,
      noAvailable: props.noAvailable
    };
  }
  render() {
    return (
      <table className="table table-striped" style={{ marginTop: 20 }}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Available In</th>
            <th>Status</th>
            <th>Number Available</th>
          </tr>
        </thead>
        <tbody>{}</tbody>
      </table>
    );
  }
}

export default Game;
